description:
"Totally great grind release. Terrorazor remind a bit of demo-era Repulsion or Hellhammer. Great, fast, old-school grind with the occasional mid-paced riff thrown in for good measure;

Slapendehonden play 8 songs of grind mixed with punk and HC. a little more modern sounding" -stole description from elsewhere.

a few left on orange vinyl, after that, it's black vinyl baby.
